import tarfile
import os

def make_slide(image_dir):
    tar = tarfile.open(image_dir+".tgz", "w:gz")
    for root, dirs, files in os.walk(image_dir):
        for f in files:
            image = os.path.join(root, f)
            tar.add(image, arcname=os.path.sep+image)
    tar.close()
    os.chmod(image_dir+".tgz", 0o444)

