import string
from array import array

def custom_alphabet(text):
    cipher = string.ascii_lowercase

    alphabet = array('u')

    for char in text:
        if char in cipher and char not in alphabet:
            alphabet.append(char)

    return alphabet.tounicode()

text = "The quick brown fox jumps over the lazy dog"
al = custom_alphabet(text)

