from datetime import date

TODAY = date.today()

EVENT_YEAR = 2024

def years_until_event(event_year):
    diff = TODAY.year - event_year
    return diff

def calculate_ages(persons, event_year):
    result = {}
    for person, birth_year in persons.items():
        age = event_year - birth_year
        result[person] = age
    return result

def print_ages(ages):
    for person in sorted(ages.keys()):
        print(f"{person}: {ages[person]} years old")

if __name__ == "__main__":
    guest_ages = calculate_ages({'Alice': 1990, 'Bob': 1985}, EVENT_YEAR)
    print_ages(guest_ages)
    event_in = years_until_event(EVENT_YEAR)
    print(f"\nThe event is in {event_in} years.")

