import json

def validate_user(user):
    if not user.get('name'):
        return False

    if user.get('age') < 18:
        return False

    gender = user.get('gender')
    if gender != 'male' and gender != 'female':
        return False

    return True

def add_user(request):
    user = json.loads(request.body)

    if validate_user(user):
        return "User added"
    else:
        return "Invalid user"

