import os
from pathlib import Path

AVATAR_DIR = Path('/var/www/avatars')

def get_avatar(user_id):
    avatar_path = AVATAR_DIR / user_id
    if not avatar_path.exists():
        return None

    return avatar_path.read_bytes()

def save_avatar(user_id, avatar_bytes):
    avatar_path = AVATAR_DIR / user_id

    avatar_path.write_bytes(avatar_bytes)

def create_avatar(user_id, avatar_bytes):
    avatar_path = AVATAR_DIR / user_id

    os.chmod(avatar_path, 0o777)

    save_avatar(user_id, avatar_bytes)

